ベイツのヴィロシタージップウォータープルーフブーツは防水素材のBates Dryライニングを内蔵した軽量防水ブーツです。<br><br>

Bates Dry防水皮膜が、水の浸入を防ぎ、ブーツ内部の湿気を逃がすことで、蒸れからくる足の疲労を軽減してくれます。<br><br>

路面のわずかな凹凸も足裏でしっかりグリップし、柔らかくすぐに足にフィットするブーツです。<br><br>

・特徴/機能<br>
柔軟性が有りふわっとした履き心地<br>
メッシュライニングによる涼却通気<br>
スポーツシューズのパフォーマンスと汎用性<br>
軽量な樹脂素材の外骨格形状のフレームにより歩行中の足のサポートと柔軟な履き心地を両立<br>
油汚れ、摩擦に強いWarrior Leatherとメッシュのアッパー素材<br>
2種類の密度の発泡素材を組み合わせたクッションインソール<br>
クッション性にとんだEVAミッドソール<br>
足底アーチをサポートするTPUパーツと耐摩耗性に優れたラバーアウトソール<br>
セメント製法<br><br>

・品番/カラー<br>
4034/Black<br>
4130/Desert <br>
4131/Gun Smoke<br>

・ヒールの高さ：約4cm（地面からかかとまでの計測です）<br>
・履き口までの高さ：約15cm（インソールから一番高い部分までの計測です）<br>
・重量：約475g（片足サイズ8EW計測）<br>
・原産国：中国<br><br>

・サイズ<br>
7EW（25.5cm～26cm）<br>
8EW（26.5cm～27cm）<br>
9EW（27.5cm～28cm）<br>
